import React from "react";

function ArtistsCard(props) {
    return (


        <div class="card bg-secondary text-white">
            <img class = "card-img-top" src= "./public/logo192.png" alt="photo ofartists photo"/> 
            <div class="card-header">{props.ArtistsName}</div>
            <div class="card-body p-5">{props.VenueList}</div>
            <div class="card-footer">{props.Genre}</div>
        </div>


    );

}

export default ArtistsCard;
